  const { getSession, logout , curentUser} = useContext(AccountContext);

  const user = curentUser()

  return (
    <div>
      <Account>
      <Header/>

        <Router>

          {
            !user ? (
              <PublicRoutes />
            ) : (
              <PrivateRoutes user={user} />
            )
          }

        </Router>

      </Account>
    </div>
  )
 }

